import React from 'react';
import {
  SafeAreaView,
  StyleSheet,
  View,
  Text,
  Pressable,
} from 'react-native';
import { 
  useFonts,
  Orbitron_400Regular,
  Orbitron_500Medium,
  Orbitron_600SemiBold,
  Orbitron_700Bold,
} from '@expo-google-fonts/orbitron';

const App = () => {
  let [fontsLoaded] = useFonts({
    Orbitron_400Regular,
    Orbitron_500Medium,
    Orbitron_600SemiBold,
    Orbitron_700Bold,
  });

  if (!fontsLoaded) {
    return null;
  }

  return (
    <SafeAreaView style={styles.container}>
      {/* Navbar */}
      <View style={styles.navbar}>
        <Text style={styles.logo}>EVE</Text>
        <View style={styles.navRight}>
          <Text style={styles.price}>$0.0150</Text>
          <Pressable style={styles.connectButton}>
            <Text style={styles.connectButtonText}>Connect Wallet</Text>
          </Pressable>
        </View>
      </View>

      {/* Hero Section */}
      <View style={styles.heroSection}>
        <View style={styles.heroContent}>
          <Text style={styles.heroTitle}>The Future of AI</Text>
          <Text style={styles.heroSubtitle}>Decentralized • Autonomous • Intelligent</Text>
          <View style={styles.statCards}>
            <View style={styles.statCard}>
              <Text style={styles.statNumber}>10K+</Text>
              <Text style={styles.statLabel}>Active Agents</Text>
            </View>
            <View style={styles.statCard}>
              <Text style={styles.statNumber}>$2.5M</Text>
              <Text style={styles.statLabel}>Total Value Locked</Text>
            </View>
            <View style={styles.statCard}>
              <Text style={styles.statNumber}>24/7</Text>
              <Text style={styles.statLabel}>Uptime</Text>
            </View>
          </View>
        </View>
      </View>
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#0A0A0A',
  },
  navbar: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: 20,
    borderBottomWidth: 1,
    borderBottomColor: 'rgba(255, 255, 255, 0.1)',
  },
  logo: {
    color: '#fff',
    fontSize: 24,
    fontFamily: 'Orbitron_600SemiBold',
  },
  navRight: {
    flexDirection: 'row',
    alignItems: 'center',
    gap: 20,
  },
  price: {
    color: '#00FF9D',
    fontSize: 16,
    fontFamily: 'Orbitron_400Regular',
  },
  connectButton: {
    backgroundColor: '#00FF9D',
    paddingVertical: 10,
    paddingHorizontal: 20,
    borderRadius: 8,
  },
  connectButtonText: {
    color: '#000',
    fontSize: 14,
    fontFamily: 'Orbitron_500Medium',
  },
  heroSection: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    padding: 20,
  },
  heroContent: {
    width: '100%',
    maxWidth: 1200,
    alignItems: 'center',
  },
  heroTitle: {
    fontSize: 72,
    color: '#fff',
    fontFamily: 'Orbitron_700Bold',
    textAlign: 'center',
    marginBottom: 20,
  },
  heroSubtitle: {
    fontSize: 24,
    color: '#00FF9D',
    fontFamily: 'Orbitron_400Regular',
    textAlign: 'center',
    marginBottom: 60,
  },
  statCards: {
    flexDirection: 'row',
    gap: 20,
    justifyContent: 'center',
    flexWrap: 'wrap',
  },
  statCard: {
    backgroundColor: 'rgba(0, 255, 157, 0.1)',
    borderWidth: 1,
    borderColor: '#00FF9D',
    padding: 30,
    borderRadius: 12,
    minWidth: 200,
    alignItems: 'center',
  },
  statNumber: {
    fontSize: 36,
    color: '#00FF9D',
    fontFamily: 'Orbitron_600SemiBold',
    marginBottom: 10,
  },
  statLabel: {
    fontSize: 16,
    color: '#fff',
    fontFamily: 'Orbitron_400Regular',
  },
});

export default App;
